import React from 'react';
import './index.css'

const Contact = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Contact Us</h1>
    </div>
  );
};

export default Contact;
